import React from 'react';
import firebase from 'firebase';
import { Button, Div, List } from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

function TestFeed() {
    const [skins, setSkins] = React.useState([])

    React.useEffect(() => {
        const fetchData = async () => {
            const db = firebase.firestore()
            const data = await db.collection("skins").get()
            setSkins(data.docs.map(doc => doc.data()))
        }
        fetchData()
    }, [])

    return (
        <Div>
        {skins.map(skin => (
    <h1 key={skin.nickname}>{skin.nickname}</h1>
        ))}
        {skins.map(skin => (
    <h2 key={skin.player_id}>{skin.player_id}</h2>
        ))}
</Div>
    );
}

export default TestFeed;
